const socketIOClient = require('socket.io-client')
const ENDPOINT = "10.1.7.222:3456";

function App() {
  const [response, setResponse] = useState("");

  useEffect(() => {
    const socket = socketIOClient(ENDPOINT);
    socket.on("FromAPI", data => {
      setResponse(data);
    });
  }, []);

    return (
      <>
        <p>
         It's {response}
            </p>
       </>
  );
}

export default App;
